import React from "react";

const Product = props => {
  const { productInfo } = props,
    { id, name, image, price, description } = productInfo;

  return (
    <div className="product-card">
      <span>Name: {name}</span>
      <img src={`/assessts/images/${image}`} />
      <span>Price: {price}</span>
      <div>{description}</div>
    </div>
  );
};

export default Product;
